Telegram в 2017: Главные события, обновления и слухи🔥

Дуров написал в своём Twitter о том, что у Telegram будет 3 сюрприза для пользователей уже в январе! А пока вы ждёте Нового года и режете салаты, мы вспомнили самые интересные события из жизни платформы в уходящем году.

✅Что произошло за год в мире Telegram:
-Прошёл слух о взломе платформы ФСБ, правда, сразу опровергнутый Дуровым;
-Мессенджер обогнал конкурентов по рейтингу в Google;
-Появилась информация о том, что Telegram использовался для подготовки терракта в Петербурге, но Дуров поставил эти данные под сомнение;
-Telegram стал мессенджером №1 в Иране и Латинской Америке;
-Роскомнадзор пригрозил Telegram блокировкой, но мессенджер держится;
-Мессенджер попал-таки в реестр организаторов распространения информации по требованию Роскомнадзора, но тайну переписки пользователей удалось сохранить;
-Telegram обошёл другие бесплатные приложения в российском AppStore;
-Telegram стал самым быстрорастущим мессенджером в России;
-Власти Индонезии внезапно и без предупреждения заблокировали Telegram, но потом сменили решение;
-Прошёл слух о выходе Telegram на ICO и создании собственной криптоплатформы;
-Власти Ирана закрыли доступ к Telegram своим жителям из-за отказа блокировать оппозиционные каналы. Мессенджер был последней подобной мейнстрим платформой, доступной в стране;

✅Что появилось нового в мессенджере:
-Появились гифки и видео — теперь фантазия пользователей не ограничена картинками и стикерами;
-В Telegram появились звонки, в том числе с опцией шифрования;
-Появилась возможность записи видеосообщений с фронтальной камеры;
-“Представьте мир, в котором вы можете заказать пиццу несколькими касаниями в Telegram” — появилась платёжная кнопка у ботов;
-Супергруппы выросли до 50 000 участников;
-Появилась функция Instant View для просмотра статей прямо в мессенджере;
-Приложения Telegram “заговорили” на разных языках;
-Добавлены уведомления об упоминаниях и ответах в переписках и чатах.

Ждём с нетерпением обещанных Дуровым январских новостей. С Наступающим!🎄✨

